import React from 'react';

function FooterContent(props){

    return(
        <div>
        <div className = "fInline">
            <i class= {props.class}></i>
            <p>{props.title}</p>
            <p>{props.text}</p>
        </div>
        </div>
    );
}

export default FooterContent;
